;; Example: {'action': 'PickupObject', 'args': ['bowl']}
;; Example: {'action': 'PickupObject', 'args': ['handtowel']}
(:action PickupObject
    :parameters (?a - agent ?l - location ?o - object ?r - receptacle)
    :precondition
        (and
            (pickupable ?o)
            (atLocation ?a ?l)
            (receptacleAtLocation ?r ?l)

            (inReceptacle ?o ?r)
            (not (holdsAny ?a))  

            (or (not (openable ?r)) (opened ?r))  

        )
    :effect
        (and
            (not (inReceptacle ?o ?r))
            (holds ?a ?o)
            (holdsAny ?a)
            (not (objectAtLocation ?o ?l))

            (increase (total-cost) 1)
        )
 )

<END>

